INSERT INTO `announcement` VALUES(2, 'Bleach Forums Rules (Please Read) [7.5.05]', 1, 1120536000, 1230699600, 'Even though Bleach Forums has always been a little lawless in the past, I always took it as the situation being under control by the staff here. However, now that I actually see what''s going on behind the scenes here at BF, it has become painfully obvious to me that this place needs a streamlined set of guidelines. So, the administration and the moderating board have finally come together and agreed on a unifed list of forum rules and regulation that will be enforced ASAP.\r\n\r\nSo, what does this mean for the regular user/poster here at Bleach Forums? One thing, you''re all obligated to read over and comprehend ALL of the points made below. No one''s holding your hand here anymore, and you''re responsible for your actions from here on out. If for some reason or another you can''t grasp a concept, PLEASE PLEASE PLEASE contact a moderator for clarification. Posting outside of these guidelines will earn you a warning, and multiple instances will earn you a ban. With that, you''ve all been warned.\r\n\r\n========================================\r\nBleach Forums Do''s and Don''ts\r\n========================================\r\n\r\n1. DO be courteous to other people.\r\n- Being friendly to one another is one of the basic building blocks of any community. Hence, we encourage people to make new users feel welcome in the Registration Desk (Introductions) forum. Likewise, positive conduct by users in threads make BF more tight-knit and seem much more accessible by people either new to the community or new to forums in general.\r\n\r\n2. DO keep your posts'' composition in check.\r\n- No one wants to read blocky posts that look like one huge run-on sentence, period. Keeping in mind that people have different writing styles, I''m aware that certain posters will have a hard time trying to keep their posts easy for others to understand. However, on sight, moderators may assess the construction of your post if it looks messy and will contact you on how to rewrite it in an acceptable manner. If you see a poster like this somewhere in the forums, please DO NOT nitpick their words as all you''ll be doing is violating the first guideline.\r\n\r\n3 DO use the forums'' search function.\r\n- Often you can avoid starting up a useless thread and have your question answered by looking for past threads that were centered around a similar topic. Also, Googling is a great alternative for more generic questions.\r\n\r\n4. DO advertise in the correct fashion.\r\n- You may only advertise if your post count has reached 50. Advertising your website is fine so long as it isn''t considered contraband (see #8) and the thread is located in the Waiting Room TV forum. However, if you advertise for chain letters or "earn quick cash" schemes, moderators will ban you permanently.\r\n\r\n5. DO wait for Bleach New Releases to be updated by moderators only.\r\n- Believe it or not, we''re fans of Bleach too! Thus, the administration and the moderating staff understand the wish for some people to announce the release of a particular chapter or episode. However, since it''s highly likely that multiple fans will announce the same release simultaneously, it''s mandated that only moderators update the BF userbase with New Release news in the Onmitsu Kidou Watchtower forum. Keep in mind, regular users can still post Bleach raws for the manga without worry.\r\n\r\n5. DO NOT flame (put-down, harass) other users.\r\n- Not only are you attempting to point out the faults you supposedly see in the other party, but you''re also selling yourself off as an all-around idiot. Keep cool here people, it''s just a forum and all you''ll accomplish in the end for starting/continuing a flame-war is a shiny ban and some laughs from your peers.\r\n\r\n6. DO NOT "scream" excessively.\r\n- Sometimes people SCREAM in forums when they hear good news, but it will almost always irk someone else. Hence for that reason, try not to SCREAM (as you can see, that means typing in all caps) since all you''re doing is breaking net ettiquette. If you SCREAM around like a moron trying to make yourself clear in a debate or conversation, others can choose to report you to the moderating staff.\r\n\r\n7. DO NOT spam (post inane material).\r\n- Spam in any way, shape, or form is restricted from being posted in Bleach Forums. Starting up a topic that is blatantly spam will earn you a warning; multiple warnings will equal a ban. The same goes for people who post spam in the middle of a thread that was previously on-topic. Not only could this lead to the closing of the thread and the end of a meaningful conversation, but it also counts towards warnings and bans. If you find spam, use the "Report a Bad Post" in the spam poster''s profile window in the thread to bring it up to the authorities.\r\n\r\n8. DO NOT post contraband sites.\r\n- So, what''s contraband on BF? Websites that post illegal copies of movies/games, pornography (of all types), grotesque and violent shock sites, and those that are racist in content are all considered contraband on BF. Users posting links to these types of sites will be permanently banned, no exceptions.\r\n\r\n9. DO NOT bring discriminatory beliefs to Bleach Forums.\r\n- Everyone has their own set of beliefs and prejudices, but they do not belong on BF. Any instances of discrimination on an ethnic, sexual, religious, or other basis will earn a user either a warning or a ban, the severity of which will be up to the answering moderator.\r\n\r\n10. DO NOT reveal spoilers.\r\n- As a rule of thumb, spoilers are instances or events in a particular movie or series that people new to it will probably have little background on. If you are unsure about whether or not something is a spoiler, play it safe and place spoiler tags around it.\r\nPHP Code:\r\n[spoiler]OMG, it''s a spoiler![/spoiler]\r\n\r\nAdditionally, if you are going to start up a thread that discusses a spoiler, LABEL YOUR THREAD accordingly. Violators will be warned, and could even be banned temporarily for multiple offenses.\r\n\r\n11. DO NOT construct oversized signatures (sigs).\r\n- In an effort to make things a bit less messy here at BF, sigs are now limited to showing a single image not exceeding 200,000 total pixels in area (if you have FC sigs, you can keep them up so long as a moderator thinks the club is using a sig image of reasonable size). This also entais not having height or width exceeding 500 pixels. Additionally, try to keep around 5 lines of text with the maximum size being 4. Have anything outside of these constraints? Keep them hidden under spoiler tags:\r\nPHP Code:\r\n[spoiler][img]www.djudgesucks.com/djudgesucks.jpg[/img]\r\n[spoiler]whatthehellisupwiththisstupidrule?[/spoiler]\r\n[spoiler=manthisiswhack]ihatethatguy[/spoiler]\r\n\r\n12. DO NOT make chat thread replicas.\r\n- If a staff member thinks a thread is a copy of the chat thread, that staff member has the right to close and move it to trash talk. (If you think this was the wrong action you may post your complain in complaints) The reason we are doing this is because all these chat thread replicas defeat the purpose of locking the chat thread at 100 pages, and all this chatting can be done in one place.\r\n\r\n\r\n========================================\r\nPenalties\r\n========================================\r\n\r\nAs with any set of rules, there are consequences for violating them. The result for breaking any of the above rules are as follows.\r\n\r\n- Being being rude to others in conversation (including SCREAMing) -\r\n1st offense = Warning from moderator.\r\n2nd offense = 1 day ban.\r\n3rd offense = Week ban or longer.\r\n\r\n- Advertising in an incorrect manner -\r\n1st offense = Week ban and thread deletion.\r\n2nd offense = Permanent ban\r\n\r\n- Taking part in a flame war -\r\n1st offense = Week ban.\r\n2nd offense = Month ban or longer.\r\n\r\n- Posting spam outside of Spam Central or repeat threads -\r\n1st offense = Warning from moderator.\r\n2nd offense = Week ban and/or possible reference to admin for loss of user priveleges.\r\n3rd offense = Permanent ban\r\n\r\n- Posting contraband sites -\r\n1st offense = Permanent ban.\r\n\r\n- Expressing discriminatory beliefs -\r\n1st offense = Warning from moderator.\r\n2nd offense = Week ban.\r\n3rd offense = Permanent ban.\r\n\r\n- Revealing spoilers -\r\n1st offense = Warning from moderator.\r\n2nd offense = Week ban.\r\n\r\n- Using an oversized sig -\r\n1st offense = Warning from moderator and involuntary edit from moderator.\r\n2nd offense = Involuntary edit of sig by moderator and day ban.\r\n3rd offense = Week ban or longer.\r\n\r\n- Deliberately bypassing curse blockers -\r\n1st offense = Warning from moderator.\r\n2nd offense = 1 day ban.\r\n3rd offense = Week ban or longer.\r\n\r\nLastly, please take note that depending on the severity of the infraction, moderators may choose to exercise harsher penalties. REMEMBER, you are responsible for your own actions. Keep that in mind, and we should all have a pleasant experience here at BF.\r\n\r\nCheers,\r\nDjudge, mgviperman, Kon, and the rest of the Bleach Forums Staff.', -1, 37800, 29);
INSERT INTO `announcement` VALUES(13, 'Gfx Rules', 5, 1100847600, 1135062000, '-------------Rules--------------\r\n1) No cheating, If you cheat, and we see you. one day ban+no gfx battles for a week. if you make a battle dureing that week your not suposta, three day ban and two weeks no gfx ^__^\r\n2) no makeing another account. and voteing for yourself. we''ll be looking at ip''s  :P\r\n3) if you can''t make the deadline. PM both a mod(perfrebleing one whoms online that moment, if not then somone whom is online a lot.) and the opponent.\r\n4) a win is a win. not a "oh you only won by 1/3 a vote" stuff.\r\n5)If it is a Tie. ask mods for help. after teh deadline. no members can vote. mods are only to be called apon for a tie breaker. before the mod voted, both members have to accept the mod, this makes sure mods can''t get faviorsisem.\r\n6)I eat things for money.\r\n7) PLAY NICE!\r\n8)if you have a problem with the rules or don''t understand, read them again. then ask me :cool:\r\n9) I wonder waht GFX stands for.......=\\\r\n10)see i diden''t really have ten rules so i make stuff up to make it look like a lot of rules ^__^', 21, 162, 29);
INSERT INTO `announcement` VALUES(17, 'Bleach Media/Fanart Changes!', 2383, 1122271200, 1124949600, 'Just a quick heads up that the Bleach Media and Original Work sections are being reorganized. \r\nFrom now on, the Bleach Media forum will host sharing and discussion of official media, such as music, radio shows, drama CDâ€™s, extra download links, etc.\r\nAisle One in Uraharaâ€™s Shoten is where works done by fans will go. Fanart, Graphics, and Videos all have their own sub-forums to make finding what youâ€™re looking for easier. All other fanworks can go in the Aisle One main forum.\r\n\r\nAny questions, comments, revelations, just PM me. \r\n-Koko', 11, 166, 29);
INSERT INTO `announcement` VALUES(19, 'RPG Guide', 749, 1133330400, 1167544800, '[center][color=blue][font=palantino linotype]A Short\r\n[size=6]Newbie Guide[/size]\r\n[size=4]on Applying and Registering a Character[/size][/font][/center][/color]\r\n\r\n\r\n\r\nHi there!\r\nSo, you like Bleach? And you like Role-Playing Games? Amazing, so do we!\r\nAnd you looked around, and liked what you saw? And now you want to join this Online RPG? Thatâ€™s so awesome of you!\r\n\r\nFirst of all, on behalf of the entire Isshindensetsu community, I would like to welcome you and thank you for deciding to join our ranks.\r\n\r\nSecond, Iâ€™d like you to meet Bob.\r\n\r\n[center][img]http://img.photobucket.com/albums/v490/AngryPolkaBoy/Isshindensetsu/Bob_Normal.gif[/img][/center]\r\n\r\nBob is a fan of Bleach for quite some time, and he also enjoys role-playing all sorts of characters; recently, Bob discovered the Isshindensetsu forums, and he would like to sign up, just like you!\r\n\r\n\r\n[color=blue][font= courier new]~ Before Registering[/font][/color]\r\nSo, Bob started thinking about stuff he would need before he signs in, like a character perhaps.\r\nHe made up a list of things he believes should be ready and outlined for him before he makes the first steps of applying:\r\n\r\n[QUOTE]\r\n\r\n    * A general idea of Bobâ€™s Character, including what division itâ€™ll be in, personality, physical description, etc.\r\n    * A general idea of where he would like to take his plot; Bob knows that people who join RPGs without a plot in mind are likely to get Writerâ€™s Block and stop playing.\r\n    * A list of topics for him to write his Sample Chapter about.\r\n\r\n[/QUOTE]\r\nNow Bob is ready to see what exactly he needs to do to get his character registered, he checks the [THREAD=18217]Application Process and Format[/THREAD] thread, reads carefully everything in it and makes sure he understands the entire thing.\r\n\r\n\r\n\r\n~ How To Apply\r\nBob then goes through the four steps of registering, he writes a Profile and a Sample Chapter (lucky he had a plot in mind and a list of ideas to choose from, now heâ€™s certain that from the very first chapter, heâ€™s going along with his awesome plot); after posting his finished product he gets various reactions, some point to mistakes he made, some to the good bits; Bob reads all of them and starts fixing the mistakes people pointed out to him, how gracious of them!\r\nOk, now Bobâ€™s application is nearly finished! He lets the Application Staff know by doing what was said on the App Process thread and waits for their review of his application.\r\n\r\nAnxious as he is, Bob reminds himself that the Application Staff are people too, and they too have real life issues like school, love life, work and friends; he makes sure not to bug them too much or ask them to review his application.\r\n\r\nThen, after waiting patiently for a few days, a post on his application is made to let him know he was accepted! Yay Bob!\r\n\r\n\r\n\r\n[color=blue][font= courier new]~ After Registering[/font][/color]\r\nNow, Bob has a registered character, and he can start writing his plot and making collaborative works with other RPers!\r\nBut before he jumps the gun, Bob stops to think of things he needs to do right after he got accepted:\r\n\r\n[QUOTE]\r\n\r\n    * He needs to post his characterâ€™s profile in the Gotei Personnel Register sub-forums.\r\n    * He needs to post his characterâ€™s name, division and seat in the [THREAD=9062]Divisions[/THREAD] thread, and contact info (like AIM screen name and E-mail) in the [THREAD=12819]Screen-Names[/THREAD] thread.\r\n    * He needs to IM/PM his divisionâ€™s Captain and let him/her know he joined it, as well as asking (politely, of course) for an admission collab to start his shinigami career on the right foot.\r\n\r\n[/QUOTE]\r\nBob goes through the list and does everything in it, now the entire RPG knows that Bobâ€™s character joined the Shin-Gotei, heâ€™s ready to start writing his volumes and chapters, collabing with other RPers and generally being a part of the Isshindensetsu experience!\r\n\r\n[center][img]http://img.photobucket.com/albums/v490/AngryPolkaBoy/Isshindensetsu/Bob_shinigami.gif[/img][/center]\r\n\r\nCongratulations Bob!\r\n\r\n\r\n~\r\n\r\n        All original characters are fictional, any relation or similarity to real-life people is completely coincidental.\r\n        No Bobs were harmed during the writing of this post.\r\n\r\n        Major thanks go to Tenshiro for the awesome sprites! <3\r\n\r\n\r\n[center][font=Palantino linotype] [color=blue]\r\n         [size=3]The[/size]\r\n[size=6]Isshindensetsu Index[/size]\r\n            [size=1]Ver. 3.0[/size]\r\n[/center][/font][/color]\r\n\r\n\r\n\r\nGeneral Explanations\r\n\r\n    * [THREAD=12145]Application Tutorial and FAQ[/THREAD] â€“ Helpful tips of how to improve your profile before being accepted.\r\n    * [THREAD=2697]What is a Text-Based RPG?[/THREAD] â€“ For those new to this kind of role-playing, or to role-playing in general.\r\n    * [THREAD=2625]What are Volumes and Chapters?[/THREAD] â€“ Generally speaking, how to post on the Field Missions sub-forum.\r\n    * [THREAD=2623]Grading Scales[/THREAD] â€“ How your chapters and fights are graded (including Sou Kyouku fights)\r\n    * [THREAD=4780]Common Bleach-Related Words[/THREAD] â€“ If youâ€™re confused by some of the Japanese words.\r\n\r\n\r\n\r\nThe RPGâ€™s Inner-Workings\r\n\r\n    * [THREAD=18380]Rules and Regulations[/THREAD] â€“ A list of the RPGâ€™s Ten Commandments.\r\n    * [THREAD=11929]Staff Listing[/THREAD] â€“ A list of all people who are a part of a certain staff in the RPG, meaning theyâ€™re the ones who set the rules and approve petitions in that area.\r\n    * [THREAD=12216]Seireitei Chain of Command[/THREAD] â€“ A short explanation of the hierarchy of all the parties that run Seireitei.\r\n    * [THREAD=12989]Judiciary Board Meeting Minutes[/THREAD] â€“ Posts made on this thread hold new information and regulations about the way we RP, as well as various decisions made by the Judiciary Board.\r\n    * [THREAD=3393]Divisionsâ€™ Specializations[/THREAD] â€“ Each division is listed here along with the specialty chosen by its respective captain.\r\n    * [THREAD=20468]Soukyoko Hill System and Rules[/THREAD] - Everything you need to know about how fights on the highest place in Seireitei are going to happen.\r\n    * [THREAD=18377]Hybrid Rules[/THREAD] â€“ Facts and rules you need to know when coming up with a Vaizard/Arrancar NPC, or when interacting with a Vaizard PC.\r\n\r\n\r\n\r\nGotei History\r\n\r\n    * [THREAD=2683]Timeline[/THREAD] â€“ A chronological description of the chain of events leading to the current RPG plot.\r\n    * [THREAD=5165]Former Captains of the Gotei[/THREAD] â€“ Those who were in charge of the thirteen divisions before the Great Hollow War.\r\n    * Plot Sensitive Material â€“ The showcase for all of the RPGâ€™s official canon plots and writing pieces.\r\n\r\n\r\n\r\nVarious Aspects of Your Character\r\n\r\n    * [THREAD=18376]Stats Thread[/THREAD] â€“ A full explanation of everything you need to know about your characterâ€™s stats.\r\n    * [THREAD=18377]Zanpakutou Information[/THREAD] â€“ Everything you need to know about your characterâ€™s main piece of weaponry.\r\n    * [THREAD=10109]Techniques[/THREAD] â€“ Special abilities, skills, maneuvers, fighting styles and so on that your character can learn and practice.\r\n    * [THREAD=3536]Kidou[/THREAD] â€“ A full library of all Demon Arts available for your character to cast, including prices, ranks and in-depth descriptions.\r\n    * [THREAD=4065]Items and Equipment[/THREAD] â€“ Various items your character can carry around.\r\n\r\n\r\n\r\nRegistration, Approval and Generation Threads\r\n\r\n    * [THREAD=12756]Application Final Draft Announcement Thread[/THREAD] â€“ This is where you let the Application Staff know your application is ready to be reviewed for approval.\r\n    * [THREAD=6144]Technique Generation Thread[/THREAD] â€“ Here you can make proposals for new techniques and fighting styles.\r\n    * [THREAD=13077]Feat Generation Thread[/THREAD] â€“ In here you post your characterâ€™s unique feats for approval.\r\n    * [THREAD=2821]Kidou Generation Thread[/THREAD] â€“ This is where you post ideas for new kidou spells you came up with.\r\n    * [THREAD=18694]Zanpakutou Releases Approval Thread[/THREAD] â€“ The Zanpakutou staff will list approved/disapproved/pending soul cutter releases in here. This also has an explanation of how to get your zanpakutou release approved.\r\n\r\n\r\n\r\nPrC (Prestige Classes)\r\n\r\n    * [THREAD=18507]Sun Echelon[/THREAD] - Master Shinigami. Warriors of legendary status that truly stand above all others.\r\n    * [THREAD=9636]Kidoushuu[/THREAD] - The Kidou Brigade. A Gotei''s suborganization that''s composed of experts with the Demon Arts.\r\n    * [THREAD=18739]The Excelsior[/THREAD] - A rogue group of shinigami who wave the band of morality.', 42, 3553, 29);
INSERT INTO `announcement` VALUES(20, 'The Social, And you.', 5, 1222498800, 1288249200, 'Alright, I am sick.  And tired of seeing people post threads like;\r\n"IS BLEACH THE BEST?!"\r\n"WHO LIKES ICHIGO?!"\r\n"WAT BLEACH SWORD DA BEST!!1!?!"\r\n\r\nSo, If you have noticed. I have moved a lot of threads around to another section of the forums.\r\n\r\nThis section is called, "GENERAL BLEACH TALKBACK"\r\nOh, What does that mean to me? The normal everyday poster?\r\n\r\nNothing!  Go about what you do kind Sir/Ma''am.\r\n\r\nWhat does that mean to me?  The poster who thinks the social is for anything I feel like posting about?\r\n\r\nThat you need to move your threads. I am sick of this.  So, so, so sick of this.\r\n\r\nNew Rule. applies ONLY to the Social section of these forums.\r\nIf you post a Thread about something related to Bleach Manga/Anime, like the examples I gave above.\r\n\r\nIt will be moved, You will get an infraction. Do it again. And I give you another. and trash the threads.\r\n\r\nYou don''t want to do it YET AGAIN. Trust me. \r\n\r\nThank you for your time.\r\n\r\n~Bleach7/Bleachforums Staff.', 14, 227, 29);
